  }
  async forceDelete(id) {
    return await this.api.delete(`/${id}`).data;
  }
  async update(id, data) {
    return await this.api.put(`/${id}`, data).data;
  }
  async deleteAll() {
    return (await this.api.delete("/")).data;
  }

  async delete(id) {
    return (await this.api.delete(`/${id}`)).data;
  }
}

